import axios from 'axios';
import React, { useContext, useEffect } from 'react';
import Header from '../../components/header/header';
import { GlobalContext } from '../../context/globalStateContext';
import { ContainerBase } from '../../style';
import { ContainerList, ContainerPage, EachClient } from './style';

export default function FourPage() {
  const context = useContext(GlobalContext)

 return (
   <ContainerBase>
        <Header/>
        <ContainerPage>
          <ContainerList>
            {context.clients.map((client, key)=>{
              return(
                <EachClient key={key}>
                  <div>
                    <span>name: {client.name}</span>
                    <span>email:</span>
                    <span>telefone:</span>
                    <span>endereco:</span>
                    <span>cpf:</span>
                  </div>
                  <section>
                    <button>E</button>
                    <button>X</button>
                  </section>
                </EachClient>
              )
            })}
          </ContainerList>
        </ContainerPage>
   </ContainerBase>
 );
}
